  \"alamosa-monte-vista-national-wildlife-refuge-complex-colorado-comprehensive-conservation-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Alamosa-Monte Vista NWR Complex for the next
  15 years. This plan outlines the Complex vision and purpose and describes how Alamosa-Monte
  Vista NWR Complex will contribute to the overall mission of the Refuge System. The
  plan provides an introduction to the Complex an overview of the CCP process, a summary
  of Refuge resources, information about the management direction, and strategies
  for implementing monitoring. Key planning issues include: wildlife, naturalness,
  water, public use, weeds, and elk.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
